import React from 'react';

const Project = () => {
  return (
    <div>
      <h2>My Projects</h2>
      {/* Add content for each project */}
      <div>
        <h3>Project 1</h3>
        <p>Description of Project 1.</p>
      </div>
      <div>
        <h3>Project 2</h3>
        <p>Description of Project 2.</p>
      </div>
      {/* Add more projects as needed */}
    </div>
  );
};

export default Project;
